// About.js
import React from 'react';

const About = () => {
  return (
    <div className='about'>
      <h2>Sobre nosotros</h2>
      <p>DIY4Rent es un marketplace online para el alquiler de herramientas para que tu puedas llevar a cabo is an online marketplace for renting tools for your DIY projects.</p>
    </div>
  );
};

export default About;
